import React from "react";
import {Link } from 'react-router-dom';
import style from "./landin.module.css"
import img from "../IMG/1.jpg"

 function Landing() {

  return (
   
    <div >
     <div>
     <img  className={style.img} src="1.jpg"/>
      <h1 className={style.texto}>Welcome to World</h1>
     <Link to="/Home">
     <button className={style.button} >aqui vamos al home</button>
     </Link>
     
      </div>
    </div>
  );
}

export default Landing;
